import logo from './logo.svg';

function App() {
  return (
    <div className="App">
      <header>
        <h1 className='container my-5'>Carrington analyzer</h1>
        <p>Trying to prevent a disaster caused by Carrington Events, we present an pipeline that tracks solar wind speed.</p>
      </header>
    </div>
  );
}

export default App;
